import org.apache.spark.AccumulatorParam

object MaxAccumulatorParam extends AccumulatorParam[Int] {
    def zero(initialValue: Int): Int = {
        Int.MinValue
    }

    def addInPlace(v1: Int, v2: Int): Int = {
        Math.max(v1, v2)
    }
}

val inputFile = "grupo04/lab-1/data/scihub_data/dec2015.tab"

val maxLength = sc.accumulator(0)(MaxAccumulatorParam)

def loadFile(file : String) = sc.textFile(file).map(line => {
    maxLength += line.trim.length

    line.trim.split("\t")
})

loadFile(inputFile).count
println("Longitud maxima lineas del archivo: " + maxLength.value)
